import React, { useRef, useState } from 'react';
import axios from 'axios';
import './BG.css';

export default function VideoEditor() {
  const inputRef = useRef();
  const [videoFile, setVideoFile] = useState(null);
  const [videoPreview, setVideoPreview] = useState(null);
  const [outputVideo, setOutputVideo] = useState(null);
  const [loading, setLoading] = useState(false);
  const [tool, setTool] = useState('');
  const [start, setStart] = useState(0);
  const [end, setEnd] = useState(5);
  const [effect, setEffect] = useState('');

  const handleUpload = (e) => {
    const file = e.target.files[0];
    if (file && file.type.startsWith("video/")) {
      setVideoFile(file);
      setVideoPreview(URL.createObjectURL(file));
      setOutputVideo(null);
    }
  };

  const handleProcess = async () => {
    if (!videoFile || !tool) return alert("Select a tool and upload a video.");

    setLoading(true);
    const formData = new FormData();
    formData.append("video", videoFile);
    formData.append("tool", tool);

    if (tool === "clip") {
      formData.append("start", start);
      formData.append("end", end);
    } else if (tool === "effect") {
      formData.append("effect_type", effect);
    }

    try {
      const res = await axios.post("http://localhost:8000/process", formData, {
        headers: { "Content-Type": "multipart/form-data" },
        responseType: "blob"
      });

      const blob = new Blob([res.data], { type: "video/mp4" });
      setOutputVideo(URL.createObjectURL(blob));
    } catch (err) {
      console.error(err);
      alert("Processing failed");
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="BG">
      <div className="SideBar">
        <ul>
          <li onClick={() => inputRef.current.click()}>Upload</li>
          <li onClick={() => setTool("bg")}>Remove BG</li>
          <li onClick={() => setTool("clip")}>Clip</li>
          <li onClick={() => setTool("crop")}>Crop</li>
          <li onClick={() => setTool("effect")}>Effects</li>
        </ul>
      </div>

      <div className="BodyBar">
        <input
          ref={inputRef}
          type="file"
          accept="video/*"
          style={{ display: "none" }}
          onChange={handleUpload}
        />

        {videoPreview && (
          <div className="PreviewBox">
            <video src={videoPreview} controls />
          </div>
        )}

        {tool && (
          <div className="ToolControls">
            {tool === "clip" && (
              <>
                <label>Start Time (s):</label>
                <input type="number" value={start} onChange={(e) => setStart(e.target.value)} />
                <label>End Time (s):</label>
                <input type="number" value={end} onChange={(e) => setEnd(e.target.value)} />
              </>
            )}
            {tool === "effect" && (
              <>
                <label>Effect:</label>
                <select value={effect} onChange={(e) => setEffect(e.target.value)}>
                  <option value="grayscale">Grayscale</option>
                  <option value="invert">Invert</option>
                  <option value="blur">Blur</option>
                </select>
              </>
            )}
            <button onClick={handleProcess}>Apply</button>
          </div>
        )}

        {loading && <p style={{ color: "white" }}>Processing...</p>}

        {outputVideo && (
          <div className="OutputBox">
            <h4>Processed Video:</h4>
            <video src={outputVideo} controls />
            <a href={outputVideo} download="processed_video.mp4">
              <button>Download</button>
            </a>
          </div>
        )}
      </div>
    </div>
  );
}
